import logo from './logo.svg';
import './App.css';
import NavBar from './Navbar';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Today <code>3 June 2024</code> to staart the web developer Internship.
        </p>
        <Navbar />
                  4 TechStar Solutions.

      </header>
    </div>
  );
}

export default App;
